import "./../../src/App.css"


const Profile = () => {
  return (
    <div className="content">
      <div className="cont-up-img">
        <img src="https://sun9-39.userapi.com/impf/0WHZBC0ZDCeCJmuZ5ioxID8uluYBudUsldkc3A/3pYVY7lDemE.jpg?size=1590x530&quality=95&crop=1118,0,2242,747&sign=5acd1d3714234619a78a8f3a081630e8&type=cover_group"></img>
      </div>
      <div>ava + description</div>
      <div>My post</div>
      <div>New post</div>
      <div>Post 1</div>
      <div>Post 2</div>
    </div>
  );
};

export default Profile;
